  min-height: 100vh;
  position: relative;
  background-color: #131524;
  color: #b6b6b6;
  padding: 44px 0;
  width: ${props => props.collapse ? "80px":"240px"};
`;

const LogoItem = styled.div`
  height: 32px;
  width: 100%;
  padding-left: 24px;
  padding-right: 24px;
  margin-bottom: 16px;
  display: flex;
  gap: 8px;
  align-items: center;
`;

const Logo = styled.span`
  content: "";
  width: 32px;
  height: 32px;
  display: inline-block;

  background-color: #fff;

`;

