  margin-left: 24px;
  margin-right: 24px;
  margin-bottom: 32px;
  background-color: #fff;
`;

const Section = styled.div`
  margin-bottom: 24px;
`;

const SectionTitle = styled.div`
  font-size: 14px;
  font-weight: 200;
  line-height: 1;
  height: 16px;
  padding-left: 24px;
  padding-right: 24px;
  margin-bottom: 4px;
`;

const SectionText = styled.span`
  margin-left: 8px;
  height: 16px;
  min-height: 16px;
  content: "";
`;

const SectionItem = styled.div`
  width: 100%;
  height: 40px;
  padding-left: 24px;
  padding-right: 24px;
  padding-top: 12px;
  padding-bottom: 12px;
  margin-bottom: 4px;
  background-color: #1b1c3a;
`;

const SideBarCardSlot = styled.div`
  content: "";
  width: 100%;
  height: 208px;

  margin-bottom: 48px;
  margin-top: 48px;
`;

const SideBarCard = styled.div`
  content: "";
  width: 100%;
  height: 100%;
  padding-left: 24px;
  padding-right: 24px;
  padding-top: 12px;
  padding-bottom: 12px;
  background-color: #1b1c3a;
`;

const Divider = styled.div`
  border-bottom: 1px solid grey;
  margin-top: 16px;
  margin-bottom: 16px;
`;





